import logo from './logo.svg';
import './App.css';

function App() {
  return (
    <div className="App">
      <form>
        <label>Enter a project name</label>
        <input type="text"/>
        <button type="submit">Submit</button>
      </form>
    </div>
  );
}

export default App;
